import { div,IconButton } from "@material-ui/core";
import React,{ useState } from "react";
import { MTableBodyRow } from "material-table";
import ModeEditOutlineOutlinedIcon from '@mui/icons-material/ModeEditOutlineOutlined';
import PatientForm from "../patientForm";
import './button.css'
import { Button } from "@material-ui/core";
import {
    Dialog,
    DialogContent,
    DialogTitle
}from '@mui/material'
const CustomRow= (props)=>{
    const [openEditDialog,setOpenEditDialog] = useState(false);
    const [dialogType,setDialogType] = useState("EDIT");
    const overlayStyle={width:"100%",position:"absolute"}
    return <div style={{display:'contents'}}>
        <Dialog open={openEditDialog} PaperProps={{ style: {
            minHeight: '90%',
            maxHeight: '90%',
            minWidth: '900px'
        }}}>
            <DialogTitle>
              Patient Edit Form{dialogType}
              <Button style={{background: "red",color:"white",float:"right"}} onClick={()=> {
                    setOpenEditDialog(false)
                }} className="CloseButton">X</Button>
            </DialogTitle>
            <DialogContent>
              <PatientForm dialogMethod={dialogType}/>
            </DialogContent>
        </Dialog>
        <div align="right" style={overlayStyle}>
            <div>
                <IconButton style={{marginRight:"35px"}} onClick={()=> {
                    setOpenEditDialog(true)
                }}>
                    <ModeEditOutlineOutlinedIcon />
                </IconButton>
            </div>
        </div>
        <MTableBodyRow {...props} />
    </div>

}

export default CustomRow;
